import { Outlet, Link } from "react-router-dom";
import './static/Layout.css'
const Layout = () => {
  return (
    <>
        <div className="menu">    
            <div><Link to="/">Post</Link></div>
          <div><Link to="/view">View</Link></div>
         <div><Link to="/category">Category</Link></div>
        <div><Link to="/subcategory">Sub Category</Link></div>
       </div>

      <Outlet />
    </>
  )
};

export default Layout;
